import '../index.css'
import logo from '../imgs/logo-2.png'

function Header() {
    return (
        <nav className="bg-black h-20 flex align-middle justify-between">
            <img src={logo} alt="SportSee" className="max-h-16" />
        </nav>
    )
}

export default Header
